import './Container.css';
// 배너 이미지 import
import banner1 from '../media/banner1';
import banner2 from '../media/banner2';
import banner3 from '../media/banner3';

function Container() {
    return(
        <div className="container">
            <div>
                <img src={banner1}></img>
            </div>
        </div>
    );
};

export default Container;
